  top: 0;
  left: 10vw;
  width: 90vw;
  height: 90vh;
  background-color: ${Colors.INDIGO};
  padding: 1.5rem;
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
  align-items: center;
`;

export const MobileMenu: React.FC = () => {
